import react from "react";
import Navbar from "./components/navbar/Navbar";
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";
import './App.css';
export default function App() {
  return (
    <>
        <Router>
            <Navbar />
            <Switch>
                <Route path="/" exact />
            </Switch>
        </Router>
    </>
  );
}
